import React from "react";
import Cards from './Cards';
import Sdata from './Sdata';


function Lol() {
    function ncard(val) {
        console.log(val)
        return (
            <Cards
                snam={val.sname}
                titl={val.title}
            />
        )
    };

    return (
        <div className="demo">
            {Sdata.map(ncard)}
        </div>
    )
}
export default Lol;
